import React,{Component} from 'react';
import {CartContext} from './dataCart' 

export default class Cart extends Component{
    constructor(props){
        super(props);
        this.state=[]
    }
    render(){
        return(
            <div className='container'>
                <ul>
               <CartContext.Consumer>
                   {
                       ({cartItems}) => cartItems.map(item => <li>{item.name}</li>)
                   }
               </CartContext.Consumer>
               </ul>
            </div>
        )
    }
}
